    static String isValidString(String s,String a) {

        final String GOOD = "YES";
        final String BAD = "NO";
        String ret = GOOD;

        int len1 = s.length(), len2 = a.length();
        if (len1 <= 3)
            return GOOD;

        Map<Character, Integer> hashMap = new HashMap<>();
        for (int i = 0; i < len1; i++) {
            char ch = s.charAt(i);
            hashMap.computeIfPresent(ch, (key, val) -> ++val);
            hashMap.putIfAbsent(ch, 1);
        }
        for (int i = 0; i < len2; i++) {
            char ch = a.charAt(i);
            hashMap.computeIfPresent(ch, (key, val) -> ++val);
            hashMap.putIfAbsent(ch, 1);
        }
        System.out.println("map1 " + hashMap);

        Map<Integer, Integer> hashTwo = new HashMap<>();
        for (Map.Entry<Character, Integer> entrySet : hashMap.entrySet()) {
            int value = entrySet.getValue();
            hashTwo.computeIfPresent(value, (key, val) -> ++val);
            hashTwo.putIfAbsent(value, 1);
        }
        System.out.println("map2 " + hashTwo);
        if(hashTwo.size()==1)
            return GOOD;
        if (hashTwo.size() > 2)
            return BAD;

        int count = 0;

        List<Map.Entry<Integer, Integer>> list = new LinkedList<>(hashTwo.entrySet());

        if (Math.abs(list.get(0).getKey() - list.get(1).getKey()) == 1 &&
                (list.get(0).getValue() == 1 || list.get(1).getValue() == 1))
            count++;
        else if (list.get(0).getValue() == 1 && list.get(0).getKey() == 1)
            count++;
        else if (list.get(1).getValue() == 1 && list.get(1).getKey() == 1)
            count++;

        if (count == 0)
            ret = BAD;

        return ret;
    }

